public Version loadVersion(String versionKey) throws Exception {
  Version version = null;
  try {
    byte[] data = db.get(bytes(versionKey));
    if (data != null) {
      version = new VersionPBImpl(YarnServerCommonProtos.VersionProto
          .parseFrom(data));
    }
  } catch (DBException e) {
    throw new IOException(e);
  }
  return version;
}
